  public static void main(String[] args) throws OrtException, IOException {
        NativeLibLoader.addNativeDir("/my_onnx/");
        NativeLibLoader.addNativeDir("my_onnx/");
        NativeLibLoader.initForOnnx();

        ScoreMNIST tmp = new ScoreMNIST();
        tmp.loadModel();
        String[] argsLocal = new String[2];
        byte[] modelArray = tmp.readAllBytesOrExit();

        System.out.println("java.library.path");
        System.out.println(System.getProperty("java.library.path"));
        for (String libName : libNamesForOnnx) {
             System.load(tempDirectoryForOnnx + libName);
        }

        if (argsLocal.length < 2 || argsLocal.length > 3) {
            System.out.println("Usage: ScoreMNIST <model-path> <test-data> <optional:scikit-learn-flag>");
            System.out.println("The test data input should be a libsvm format version of MNIST.");
            return;
        }
        Date date = new Date();
        long startTime = date.getTime();


        try (OrtEnvironment env = OrtEnvironment.getEnvironment();
             OrtSession.SessionOptions opts = new SessionOptions()) {

            opts.setOptimizationLevel(OptLevel.BASIC_OPT);
            try (OrtSession session = env.createSession(modelArray, opts)) {

                InputStream inputData = Thread.currentThread().getContextClassLoader().getResourceAsStream("my_onnx/mnist.t");
                System.out.println("Loading data from " + inputData);

                System.out.println("Inputs:");
                for (NodeInfo i : session.getInputInfo().values()) {
                    System.out.println(i.toString());
                }

                System.out.println("Outputs:");
                for (NodeInfo i : session.getOutputInfo().values()) {
                    System.out.println(i.toString());
                }

                SparseData data = load(inputData);

                float[][][][] testData = new float[1][1][28][28];
                float[][] testDataSKL = new float[1][780];

                int correctCount = 0;
                int[][] confusionMatrix = new int[10][10];

                String inputName = session.getInputNames().iterator().next();

                for (int i = 0; i < data.labels.length; i++) {
                    if (argsLocal.length == 3) {
                        writeDataSKL(testDataSKL, data.indices.get(i), data.values.get(i));
                    } else {
                        writeData(testData, data.indices.get(i), data.values.get(i));
                    }

                    float[][] tmpData = new float[1][784];
                    for (int ii = 0; ii < testData[0][0].length; ii++) {
                        for (int iii = 0; iii < testData[0][0][0].length; iii++) {
                            tmpData[0][ii * 28 + iii] = testData[0][0][ii][iii];
                        }
                    }

                    try (OnnxTensor test =
                                 OnnxTensor.createTensor(env, argsLocal.length == 3 ? testDataSKL : tmpData);
                         Result output = session.run(Collections.singletonMap(inputName, test))) {

                        int predLabel;

                        if (argsLocal.length == 3) {
                            long[] labels = (long[]) output.get(0).getValue();
                            predLabel = (int) labels[0];
                        } else {
                            float[][] outputProbs = (float[][]) output.get(0).getValue();
                            predLabel = pred(outputProbs[0]);
                        }
                        if (predLabel == data.labels[i]) {
                            correctCount++;
                        }

                        confusionMatrix[data.labels[i]][predLabel]++;

                        if (i % 1000 == 0) {
                            System.out.println("Cur accuracy = " + ((float) correctCount) / (i + 1));
                            System.out.println("Output type = " + output.get(0).toString());
                            if (argsLocal.length == 3) {
                                System.out.println("Output type = " + output.get(1).toString());
                                System.out.println("Output value = " + output.get(1).getValue().toString());
                            }
                        }
                    }
                }

                System.out.println("Final accuracy = " + ((float) correctCount) / data.labels.length);

                StringBuilder sb = new StringBuilder();
                sb.append("Label");
                for (int i = 0; i < confusionMatrix.length; i++) {
                    sb.append(String.format("%1$5s", "" + i));
                }
                sb.append("\n");

                for (int i = 0; i < confusionMatrix.length; i++) {
                    sb.append(String.format("%1$5s", "" + i));
                    for (int j = 0; j < confusionMatrix[i].length; j++) {
                        sb.append(String.format("%1$5s", "" + confusionMatrix[i][j]));
                    }
                    sb.append("\n");
                }

                System.out.println(sb.toString());
            }
        }
        Date date2 = new Date();
        System.out.println(date2.getTime() - startTime);
        System.out.println("Done!");
    }
